import { Button, Container, Row, Col, Form} from "react-bootstrap"
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSearch, faMapLocation } from '@fortawesome/free-solid-svg-icons';
import Header from './Header';

function RestaurantList(){

    return(
        <div>
            <Header/>
            <Container>
                <Row className=" mt-4">
                    <Col>
                    <h1>Znajdź restaurację w swojej okolicy</h1>
                        <Form.Control type="text" className="search-bar" placeholder="Szukaj..." />
                        <Button variant="danger" className="search-icon"><FontAwesomeIcon icon={faSearch} /></Button>
                    </Col>
                </Row>
            </Container>
        </div>
    )
}

export default RestaurantList
